describe("pm.view",function(){module.declare(["pm","pm.view"],function(a){var b=a("pm"),c=a("pm.view"),d=b.utils;describe("pm.view object",function(){it("pm.view is a function",function(){expect(d.isFunction(c)).toBe(!0)}),it("defined view.create",function(){expect(c.create).toBeDefined()});var a=function(){},b={click:"clickEvent"},e=c.create({fun:a,events:b});it("create a view,add fun method",function(){expect(e.fun).toBe(a)}),it("create a view,add events",function(){expect(e.events).toEqual(b)}),it("view.get method",function(){expect(c.prototype.get).toBeDefined()}),it("view.set method",function(){expect(c.prototype.set).toBeDefined()}),it("view.save method",function(){expect(c.prototype.save).toBeDefined()})})})});